export class Priapisme {
    IdPriapisme: number;
    PatientId: number;
    Priapisme1: boolean;
    Nombre: number;
    Date: string;
    HeureSurvenue: string;
    DureeEpisode: number;
    ErectionDoulouruse?: boolean;
    ErectionNonDouloureuse?: boolean;
    Autre?: boolean;
    PreciserAutre?: string;
    Hospitalisation: boolean;
    LieuHospitalisation?: string;
    HyperhydratationPerso?: boolean;
    HyperhydratationIv?: boolean;
    AntalgiquesPalliesI?: boolean;
    AntalgiquePallierIi?: boolean;
    AntalgiquePallierIii?: boolean;
    TransfusionSimple?: boolean;
    EchangeTransfusionnel?: boolean;
    ResolutionSpontanee: boolean;
    DureePriapisme?: number;
    TraitementMedicalSpecifique: boolean;
    DelaiTraitementMedical?: number;
    TypeTraitementMedical?: string;
    TraitementChirurgical: boolean;
    DelaiTraitementChirurgical?: number;
    TypeTraitementChirurgical?: string;

    constructor() {
        this.IdPriapisme = 0;
        this.PatientId = 0;
        this.Priapisme1 = false;
        this.Nombre = 0;
        this.Date = '';
        this.HeureSurvenue = '';
        this.DureeEpisode = 0;
        this.ErectionDoulouruse = false;
        this.ErectionNonDouloureuse = false;
        this.Autre = false;
        this.PreciserAutre = '';
        this.Hospitalisation = false;
        this.LieuHospitalisation = '';
        this.HyperhydratationPerso = false;
        this.HyperhydratationIv = false;
        this.AntalgiquesPalliesI = false;
        this.AntalgiquePallierIi = false;
        this.AntalgiquePallierIii = false;
        this.TransfusionSimple = false;
        this.EchangeTransfusionnel = false;
        this.ResolutionSpontanee = false;
        this.DureePriapisme = 0;
        this.TraitementMedicalSpecifique = false;
        this.DelaiTraitementMedical = 0;
        this.TypeTraitementMedical = '';
        this.TraitementChirurgical = false;
        this.DelaiTraitementChirurgical = 0;
        this.TypeTraitementChirurgical = '';
    }
}
